import React, { useState } from 'react';
import axios from 'axios'; 
import Logo from './img/xzerologo.png'; 

function App() {
  const [webhook , setWebhook] = useState(''); 
  const [msg , setMsg] = useState('');

  function displayNone() {
    document.querySelector('#error').style.display = "none"; 
    document.querySelector('#success').style.display= "none";
  }
  function onChangeA(e) {
    setWebhook(e.target.value);
    displayNone(); 
  }
  function onChangeB(e) {
    setMsg(e.target.value);
    displayNone();  
  }

  function onSubmit(e) {
      e.preventDefault(); 
      const content = {
        "content":msg
      }
      fetch(webhook,{
        method:'POST',
        headers:{
          "content-type":"application/json"
        },
        "body":JSON.stringify(content)
      }).then(results => {
        if(results.ok === false) {
          document.querySelector('#success').style.display = "none"; 
        document.querySelector('#error').style.display = "block"; 
      } else if(results.ok === true) {
        document.querySelector('#error').style.display = "none"; 
        document.querySelector('#success').style.display="block";
      }
    })
    }
  return (
    <div className="App">
        <div className="nav">
          <h1><a href="#webhooks">Webhook Sender</a></h1>
        </div>
        <div className="section">
        <div id="error">

        </div>
        <div id="error">

            </div>
          <form onSubmit={onSubmit}>
            <label htmlFor="webhook">Webhook URL</label>
            <input id="webhook" onChange={onChangeA} />
            <label htmlFor="message">Message</label>
            <input id="message" onChange={onChangeB} />
            <button class="btn btn-primary" type="submit">Send</button>
          </form>
        </div>
    </div>
  );
}

export default App;
